EDUC3323	Planning and Assessment	This course focuses on instructional design for the classroom. Students will explore all phases of instructional planning, including modifications for diverse populations and exceptional learners. It will give them practical experience in writing objectives, using various formats of lesson plans, planning units of instruction, and planning assessment. Other topics will include authentic assessment, TEKS integration, thematic design, and content across the curriculum.	\N	\N
